INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3266989900541', 'Rôti de chapon farci aux pommes', 'Rôti de chapon assaisonné farce aux pommes : 85%,  viande de chapon avec peau : 56%, farce de volaille aux pommes : 21% (viande de dinde : 8%, pommes caramélisées : 5% (pommes : 4%, sucre, caramel : 0,2% (sucre, eau), beurre, eau), gras de porc, farine de ble, eau, conservateur : lactate de potassium, sel, oignon frit (dont huile de tournesol), arômes, ciboulette, persil, levure, antioxydant : ascorbate de sodium), barde de porc : 8%, poivre, sel, poivron rouge, arômes naturels, poudre d\'oignon, extrait d\'épice. garniture aux pommes, oignons et raisins secs : 15%, pommes : 6,8 % (pommes, sirop de sucre issu de fruit, antioxydants : acide ascorbique, anhydride sulfureux (contient sulfites), ascorbate de calcium, conservateur : sorbate de potassium), raisins secs : 6,8% (raisins secs : 6,7%, huile végétale)', 'https://static.openfoodfacts.org/images/products/326/698/990/0541/front_fr.4.400.jpg', '16', '5.3', '11', '7.5', '1.6', '13', '0.51', '0.200787401574803', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3266989900596', 'Rôti de chapon farci aux cèpes', 'Rôti de chapon assaisonné, farce aux cèpes : 85%,  Champignons forestiers : 9,6% (bolet, volvaire, pleurote, lactaire, champignon noir), oignons jaunes : 2,7%, lardons de canard fumés : 2,7% (viande séparée mécaniquement de canard : 1,4%, viande de canard : 0,9%, eau, dextrose de blé, acidifiant : lactate de potassium, sel, arômes naturels, conservateur : nitrite de sodium, antioxydant : érythorbate de sodium). Garniture aux champignons forestiers, aux oignons et aux lardons de canard fumés : 15% Viande de chapon avec peau : 56%, farce de volaille aux cèpes : 21% (viande de dinde : 12%, gras de porc, cèpes : 2,1%, eau, foies de volaille, sel, fécule de pomme de terre, arôme champignon, acidifiant : acétate de sodium, épices, antioxydant : acide ascorbique, arômes naturels), barde de porc : 8%, poivre, sel, poivron rouge, arômes naturels, poudre d\'oignon, extrait d\'épice.', 'https://static.openfoodfacts.org/images/products/326/698/990/0596/front_fr.10.400.jpg', '21', '7.4', '1.1', '0', '0', '13', '0.51', '0.200787401574803', '', '1');

