VALUES ('3267180090383', 'Histoires de glaces Glace caramel au beurre & au sel de guérande Le bac de 750', 'Lait écrémé réhydraté (origine : France), caramel 24% (sucre, crème liquide, antioxydant : alpha-tocophérol, épaississant : gomme xanthane), rubans de caramel au beurre à la fleur de sel de Guérande 5% (sirop de glucose-fructose, sucre, lait concentré sucré, crème, beurre doux, beurre à la fleur de sel de Guérande, sel de Guérande, eau, stabilisant : pectine), crème (crème, stabilisant : carraghénanes (extrait d\'algues)) (origine : UE), dextrose, beurre doux 2% (origine : France), huile de noix de coco, sucre, émulsifiant : mono et diglycérides d\'acides gras (issus d\'huiles végétales), stabilisants : farine de graines de caroube, alginate de sodium, carraghénanes (extrait d\'algues), farine de graines de guar, gomme de cellulose, sel de Guérande : 0,2%. Susceptible de contenir oeuf, fruits à coque, gluten, soja, sulfites et arachides. DaiAc', 'https://static.openfoodfacts.org/images/products/326/718/009/0383/front_fr.4.400.jpg', '10.8', '8', '28', '27.1', '', '3.6', '0.4', '0.15748031496063', '', '0');

