INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3267180362275', 'Garniture pour risotto aux fruits de mer', 'Mise en œuvre : Utilisez comme un produit frais. Idée recette : Risotto aux fruits de mer - Pour 4 personnes 250 g de riz, eau (1 fois et demi le volume de riz), une cuillère à café d\'huile d\'olive, 1 oignon, 1 cuillère à soupe de crème fraîche, une cuillère à café de parmesan râpé. Se/ poivre. Faites chauffer l\'huile d\'olive dans une poêle. Ajoutez l\'oignon haché. Versez le riz puis l\'eau. Assaisonnez. Laissez cuire à petits bouillons à couvert pendant 10 minutes. À mi-cuisson ajoutez la Garniture pour Risotto aux Fruits de Mer et laissez cuire jusqu\'à disparition complète de l\'eau. Liez le mélange avec la crème fraîche. Saupoudrez d\'un peu de parmesan râpé. Servez bien chaud. Vous pouvez également utilis -la Garniture pour Risotto aux Fruits de Mer pour accompagnr des tagliatelles fraîches.', 'https://static.openfoodfacts.org/images/products/326/718/036/2275/front_fr.4.400.jpg', '1.1', '0.3', '2.6', '0.5', '', '14', '0.79', '0.311023622047244', '', '1');

