VALUES ('3267180369977', 'Crepes emmental', 'Eau, farine de blé, ceufs entiers frais, emmental 6% , lactose et protéines de lait, huile de tournesol, farine de seigle, sel, lait écrémé en poudre, poudre à lever: E450i et E500ii, amidon de blé, arôme (contient lait), colorant: caramel E150b, eau, sucre caramélisé, poivre, muscade. Traces possibles de poisson, crustacés, mollusques, céleri, moutarde. Mise en oeuvre: A la poêle: Sans décongélation, déposez les crêpes dans une poêle anti-adhésive avec une noisette de beurre et laissez colorer doucement à feu doux 8 minutes de chaque côté. Accompagnez d\'une salade verte. Pour 100g', 'https://static.openfoodfacts.org/images/products/326/718/036/9977/front_fr.3.400.jpg', '', '', '', '', '', '', '', '', '', '1');

