VALUES ('3267180390469', 'Glace crème de citron', '_Lait_ écrémé réhydraté, crème de citron 34 % (sucre, _beurre_, _oeuf_, épaississant : pectine, jaune d\'_oeuf_, concentré de citron 3 %, huile essentielle de citron, correcteur d\'acidité : acide citrique), sucre, sirop de glucose déshydraté, jaune d\'_oeuf_, _crème_, _beurre_, brisures de fond de tarte 2 % (farine de _blé_, _beurre_ concentré (colorant : extrait de carotte), sucre _oeufs_, émulsifiants : E491 et E435, caséinates, levures désactivées, dextrose, sel, beurre de cacao), émulsifiant : E471, stabilisants : farine de caroube, alginate de sodium, carraghénanes et gomme de guar.', 'https://static.openfoodfacts.org/images/products/326/718/039/0469/front_fr.3.400.jpg', '', '', '', '', '', '', '', '', '', '0');

