VALUES ('3267180390490', 'Glace Nougat de Montélimar', 'GLACE NOUGAT DE MONTÉLIMAR Ingrédients: Lait écrémé réhydraté, sucre, crème de nougat de Montélimar Chabert et Guillot 6% (amandes émondées grillées, sucre, sirop de glucose (blé), miel, arôme naturel de vanille, pain azyme (fécule de pomme de terre, eau), albumine d\'oeuf), crème (crème, stabilisant : carraghénanes (extrait d\'algues)), dextrose, miel, beurre doux, brisures de nougat de Montélimar Chabert et Guillot 3% (amandes émondées grillées, sucre, sirop de glucose (blé), miel, albumine d\'oeuf, matière grasse végétale non hydrogénée (coprah), pain azyme (fécule de pomme de terre, eau), arôme naturel de vanille), émulsifiant : mono et diglycérides d\'acides gras (issus d\'huiles végétales), stabilisants: gomme de cellulose, farine de graines de caroube, alginate de sodium, carraghénanes (extrait d\'algues), farine de graines de guar. Susceptible de contenir autres fruits à coque, soja, sulfites et arachides.', 'https://static.openfoodfacts.org/images/products/326/718/039/0490/front_fr.4.400.jpg', '7.7', '4.1', '26', '24.9', '', '4.3', '0.1', '0.0393700787401575', '', '0');

