VALUES ('3267180390612', 'Histoires de glaces Glace Plombières au kirsch, morceaux fruits confits le bac de 485 g', 'Lait écrémé réhydraté (origine : France), sucre, cubes de fruits confits macérés au kirsch 7% (sirop de glucose fructose, pastèques, sirop de sucre inverti, écorces d\'orange, kirsch, eau, sucre, bigarreaux, gélifiant : gomme xanthane, conservateurs : sorbate de potassium, dioxyde de soufre (sulfites), acidifiant : acide citrique, colorants : carmins, bleu brillant FCF, érythrosine, caramel), jaune d\'œuf, kirsch 3%, beurre doux (origine : France), huile de noix de coco, texturant (huile de noix de coco, dextrose, lactose, lait écrémé en poudre, protéines de lait, sirop de glucose, émulsifiant : mono et diglycérides d\'acides gras, stabilisants : gomme de cellulose, farine de graines de guar), extrait de vanille, émulsifiant : mono et diglycérides d\'acides gras (issus d\'huiles végétales), stabilisants : farine de graines de caroube, alginate de sodium, carraghénanes (extrait d\'algues), farine de graines de guar, gomme de cellulose. Susceptible de contenir fruits à coques, gluten, soja et arachides.', 'https://static.openfoodfacts.org/images/products/326/718/039/0612/front_fr.4.400.jpg', '6.2', '4.5', '21.2', '20.2', '', '4.2', '0.1', '0.0393700787401575', '', '0');

